Виртуальные машины выполняют следующие функции: 
1. Виртуальная машина "Switching unit"(SWU) 
 выполняет функцию "common control" т.е. производит управление соединениями и обеспечивает реализацию функциональных возможностей станции; 
 коммутирует потоки речевой информации и данных проходящих через станцию; 
 формирует сигнализацию вызовов, акустические сигналы, коммутацию конференций, сигналы DTMF и сигналы для работы в сетях связи для модулей установленных в полках расширения. 

2.Виртуальная машина "Administration and data processor"(ADP) 
 обеспечивает загрузку системы и выход ее рабочий режим; 
 предоставляет доступ к администрированию, обслуживанию и конфигурированию системы в режиме прямого диалога; 
 предоставляет отчеты о состоянии системы и обеспечивает работу систем безопасности. 

3.Виртуальная машина "CSTA" обеспечивает интегрированные CSTA соединения к CTI приложениям 
4.Виртуальная машина "Assistant": 
 предоставляет основные функции управления, необходимые для конфигурирования и мониторинга системы; 
 может использоваться для управления как отдельной станцией через Web доступ, так и сетью таких станций с использованием внешнего Manager server. 
SoftGate (не обязательный компонент) 
SoftGate - программное приложение для PC, которое обеспечивает полный доступ IP абонентов к функциональным возможностям станции (HFA-HiPath Feature Access) с использованием распределенной архитектуры. Устанавливается на стандартный сервер с операционной системой LINUX.

СС (common control) - система общего контроля; 
CC-A - система общего контроля основная;
CC-B - система общего контроля резервная для варианта исполнения "дуплекс", наличие определяется при заказе; 
ADP (administrator & data processor) - процессор управления и обслуживания базы данных станции, эта система может иметь другие обозначения: ADS, А1. При варианте исполнения "моно" ADP конструктивно совмещается с CC-A; 
СС+ADP конструктивно образуют базовую полку, к которой подключаются все остальные периферийные устройства; 
SWU - коммутационная система, которую функционально образуют СС + полки расширения.
